		"key": "美國伊利諾芝加哥大學教授汪志雄觀點：我為什麼打從心裡看不起民進黨\n\n《台訊》：台灣網路媒體《風傳媒》27日發表美國伊利諾芝加哥大學教授汪志雄觀點文章「我為什麼打從心裡看不起民進黨」，全文如下：\n\n蔡政府上任兩年多以來，不論在內政外交還是經濟國防，其無能偏執，已經把台灣帶到了一個極為險峻的處境。今日，幾乎所有研究國際情勢的亞太專家都認定，台海兩岸是目前亞洲最危險的引爆點。然而台灣島內，上至政府，下至人民，最念念在茲，汲汲營營的，仍然是2018及2020的選舉。台灣民主曾經讓我們驕傲地站上世界的版面，諷刺的是，今日病態的台灣民主，也可能會終結台灣的富裕與未來。\n\n國民黨是一個相對有良心，但是沒有魄力，內鬥內行，自私自利的政黨。然而它現在不是執政黨，而且是一個快被打趴在地的在野黨，故擇時再述，本文在此不予評論。\n\n我有四個理由，讓我打從心裡看不起現在完全執政的民進黨。\n\n第一，民進黨是一個雙重標準，没有反省能力的政黨\n\n從轉型正義，司法改革，政治酬庸，金錢外交，到重啟核電，我們在在都看見了民進黨政府用人做事的雙重標準。以前批評反對的，到了自己執政以後都可以自圓其說，毫無一點反省的能力。其結果就是，蔡政府底下用的人，幾乎清一色都是奴才草包，以至於抬面上荒腔走板的政策，昏庸無能的決策，把台灣帶到了一個前所未有的混亂局面。\n\n第二，民進黨是一個沒有遠見，投機短視，執政無能的政黨\n\n民進黨政府欠缺高瞻遠矚，可以從大戰略思考的政治人物。所以它施政的思想模式都是短，近，快。這就好像是一個坐擁金山的敗家子，講話大聲，可是目光如豆；急於表現，但是好大喜功；手無縛雞之力，卻喜歡耀武揚威。其結果就是，政府寧願吃大虧，也要打腫臉充胖子，所以一而再，再而三的誤判情勢。在空污問題上，不惜讓人民燒煤吸炭，也要用空洞的綠能自我吹噓；在國防外交上，寧願加碼買美國二手的武器，讓自己成為別人的看門狗，把人民推向戰爭的邊緣，也要用虛幻的主權來自我麻醉。嘴上愛台灣，所作所為卻都是傷害台灣人民。\n\n第三，民進黨是一個虛偽做作，說一套做一套的醜陋政黨\n\n不管在廢死，同婚，保障勞權，居住正義，環境保護的議題上面，民進黨政府永遠是一個道貌岸然的偽善者。嘴巴上可以講出非常文青，高貴，動人的理念，實際上卻永遠是政治利益掛帥。其結果就是，表面上不廢死，卻不執行死刑，以至持續凌遲被害者家屬；表面上照顧勞工權益，卻修出了貌似進步，實則大開後門給資方的一例一休。這個黨只要是為了選舉勝利與政治奪權，就可以犧牲出賣任何的社會公義與公民價值，毫無誠信可言。\n\n第四，民進黨是一個缺乏風骨，擅長抹黑扣帽子的卑劣政黨\n\n在阿扁時代，容或爆發了多起貪污事件，民進黨內部起碼還有一個道德底線，能夠跟這樣的不法做切割。然而自小英政府上台以降，今日的民進黨完全沒有能力面對執政當局遊走於違法，違記，違憲邊緣的濫權擴權，做出任何批判與建言。尤有甚者，這個黨擅於抹黑作假，以不當手法打擊對手，更是司空見慣。\n\n其結果就是，民進黨政府經常自我矛盾，自打嘴巴。在清算國民黨的轉型正義上，民進黨表現的勇猛無比，雖千萬人吾往矣。然而在抗議日本對台灣慰安婦的殖民暴行，民進黨政府卻卑躬屈膝，容許我駐日代表公開發表背骨舔日的言論，彷彿台灣現在還是日本的殖民國一般。他們更擅長對政敵做出意識形態，思想檢查的追殺。但是背地裡，卻允許自己的黨員與支持者，一窩蜂前往中國大陸做政治進貢以賺取人民幣。其黨格之卑劣，無以為甚。\n\n一個本土的政黨，淪落到今日「記利當記自己利，求福先求自家福」的可憐地步，實在是讓人非常痛心。當人民給了機會，讓民進黨在2016年再度站起來的時候，它原本可以不負期待，把台灣帶向一個安全，開放，富足的未來。然而面對權力的貪婪，它卻選擇了一個鬥爭，封閉，對抗的道路。金錢，永遠會是檢驗人性最好的照妖鏡。現實中，能夠戳破國王新衣的，永遠是那四個小孩純真的笑容，與童稚的臉孔。枱面上把自己說的非常高貴的，在金錢的照妖鏡底下，往往會更顯出自己的醜陋。阿扁的海外建國基金，算是經典，今日小英政府的一切作為，有天也終必會被檢驗。\n\n台灣現在就像是鐵達尼號，人民只能沒有選擇的被要求團結在一起，眼睜睜地看著一個愚蠢無能的船長，帶著我們撞向冰山。天護台灣！天佑台灣！",
